import React, { useState } from "react";

const FormularioCadastro = () => {
  const [nome, setNome] = useState("");
  const [estacao, setEstacao] = useState("");
  const [periodo, setPeriodo] = useState("");
  const [data, setData] = useState("");

  const handleChangeNome = (event) => {
    setNome(event.target.value);
  };

  const handleChangeEstacao = (event) => {
    setEstacao(event.target.value);
  };

  const handleChangePeriodo = (event) => {
    setPeriodo(event.target.value);
  };

  const handleChangeData = (event) => {
    setData(event.target.value);
  };

  const handleSubmit = (event) => {
    event.preventDefault();
    // Aqui você pode fazer algo com os dados do formulário, como enviar para uma API ou realizar alguma ação no frontend
    console.log("Nome:", nome);
    console.log("Estação:", estacao);
    console.log("Período:", periodo);
    console.log("Data:", data);
  };

  return (
    <form onSubmit={handleSubmit} className="max-w-md mx-auto">
      <div className="mb-4">
        <label htmlFor="nome" className="block mb-2 font-medium">
          Nome:
        </label>
        <input
          type="text"
          id="nome"
          value={nome}
          onChange={handleChangeNome}
          className="border border-gray-300 rounded-md py-2 px-4 w-full focus:outline-none focus:ring focus:border-blue-300"
        />
      </div>

      <div className="mb-4">
        <label htmlFor="estacao" className="block mb-2 font-medium">
          Estação:
        </label>
        <select
          id="estacao"
          value={estacao}
          onChange={handleChangeEstacao}
          className="border border-gray-300 rounded-md py-2 px-4 w-full focus:outline-none focus:ring focus:border-blue-300"
        >
          <option value="">Selecione uma estação</option>
          <option value="Primavera">Primavera</option>
          <option value="Verão">Verão</option>
          <option value="Outono">Outono</option>
          <option value="Inverno">Inverno</option>
        </select>
      </div>

      <div className="mb-4">
        <label className="block mb-2 font-medium">Período:</label>
        <div>
          <label htmlFor="manha" className="flex items-center">
            <input
              type="radio"
              id="manha"
              value="Manhã"
              checked={periodo === "Manhã"}
              onChange={handleChangePeriodo}
              className="form-radio h-4 w-4 text-blue-500 focus:ring focus:border-blue-300"
            />
            <span className="ml-2">Manhã</span>
          </label>
        </div>
        <div>
          <label htmlFor="tarde" className="flex items-center">
            <input
              type="radio"
              id="tarde"
              value="Tarde"
              checked={periodo === "Tarde"}
              onChange={handleChangePeriodo}
              className="form-radio h-4 w-4 text-blue-500 focus:ring focus:border-blue-300"
            />
            <span className="ml-2">Tarde</span>
          </label>
        </div>
        <div>
          <label htmlFor="noite" className="flex items-center">
            <input
              type="radio"
              id="noite"
              value="Noite"
              checked={periodo === "Noite"}
              onChange={handleChangePeriodo}
              className="form-radio h-4 w-4 text-blue-500 focus:ring focus:border-blue-300"
            />
            <span className="ml-2">Noite</span>
          </label>
        </div>
      </div>

      <div className="mb-4">
        <label htmlFor="data" className="block mb-2 font-medium">
          Data:
        </label>
        <input
          type="date"
          id="data"
          value={data}
          onChange={handleChangeData}
          className="border border-gray-300 rounded-md py-2 px-4 w-full focus:outline-none focus:ring focus:border-blue-300"
        />
      </div>

      <button type="submit" className="bg-blue-500 text-white py-2 px-4 rounded-md hover:bg-blue-600 focus:outline-none focus:ring focus:border-blue-300">
        Enviar
      </button>
    </form>
  );
};

export default FormularioCadastro;
